We still have two issues:

* The [DATACITE_HOST env value in Ansible](https://github.com/pulibrary/princeton_ansible/blob/main/group_vars/pdc_describe/staging.yml) needs to be `doi.test.datacite.org` instead of `https://doi.test.datacite.org/`

* The prefix that we use to generate the DOI is linked to the DataCite account that login as therefore we will need to make this value (the prefix) also configurable by environment: "10.34770" for production, "10.80021" for testing. Add the value perhaps [here](https://github.com/pulibrary/princeton_ansible/blob/main/group_vars/pdc_describe/staging.yml#L42-L43) for staging.

But even if I hard-code the values in the code 

```
connection = Datacite::Client.new(username: "xx", password: "yy", host: "doi.datacite.org")
results = connection.autogenerate_doi(prefix: "10.80021")
```

